            while nums1 or nums2:
                if nums1 > nums2:
                    out.append(nums1.pop(0))
                else:
                    out.append(nums2.pop(0))
            return out

        def find_max(nums, k):
            out = []
            for i in range(len(nums)):
                if len(out) < k:
                    out.append(nums[i])
                else:
                    if nums[i] > out[-1]:
                        out.pop()
                        out.append(nums[i])
            return out

        def find_max_k(nums1, nums2, k):
            if len(nums1) < k:
                return find_max(nums2, k)
            if len(nums2) < k:
                return find_max(nums1, k)
            if len(nums1) == len(nums2) == k:
                return nums1
