    def findLadders(self, beginWord, endWord, wordList):
        """
        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: List[List[str]]
        """

        # build the graph
        graph = collections.defaultdict(list)
        for word in wordList:
            for i in range(len(word)):
                graph[word[:i] + '*' + word[i+1:]].append(word)

        # build the queue
        queue = collections.deque([beginWord])
        visited = {beginWord: 0}
        while queue:
            word = queue.popleft()
            for i in range(len(word)):
                for j in range(26):
                    neighbor = word[:i] + chr(ord('a') + j) + word[i+1:]
                    if neighbor in graph:
                        if neighbor in visited:
                            continue
                        visited[neighbor] = visited[word] + 1
                        queue.append(neighbor)
                        if neighbor == endWord:
                            break
        else:
            return []

        # build the result
        result = []
        while queue:
            word = queue.popleft()
            if word == endWord:
                result.append([endWord])
                break
            for i in range(len(word)):
                for j in range(26):
                    neighbor = word[:i] + chr(ord('a') + j) + word[i+1:]
                    if neighbor in graph and visited[neighbor] == visited[word] + 1:
